            y(262,1) = y0(231)*p.koff + y0(246)*p.kf5 + y0(254)*y0(8)*p.kff + y0(258)*y0(8)*p.kff - 2*y0(262)*p.kfr - y0(262)*p.koff;
            % BRAF(ras=3, d=1, vem=4, erk=2) % BRAF(ras=None, d=1, vem=5, erk=None) % ERK(s=2, sos=None, state='up') % KRAS(raf=3, sos=None, state='gdp') % Vem(raf=5) % Vem(raf=4);
            y(263,1) = y0(231)*p.koff + y0(247)*p.kf5 + y0(255)*y0(8)*p.kff + y0(259)*y0(8)*p.kff - 2*y0(263)*p.kfr - y0(263)*p.koff;
            % BRAF(ras=3, d=1, vem=4, erk=2) % BRAF(ras=None, d=1, vem=6, erk=5) % ERK(s=5, sos=None, state='up') % ERK(s=2, sos=None, state='up') % KRAS(raf=3, sos=None, state='gdp') % Vem(raf=6) % Vem(raf=4);
            y(264,1) = 2*y0(232)*p.koff + y0(248)*p.kf5 + y0(260)*y0(8)*p.kff + y0(261)*y0(8)*p.kff - 2*y0(264)*p.kfr - y0(264)*p.koff;
        end

        function y_obs = get_observables(self, y)
            % Retrieve the trajectories for the model observables
            % from a matrix of the trajectories of all model
            % species.

            % Initialize the struct of observable timecourses
            % that we will return
            y_obs = struct();

            % Iterate over the observables;
            observable_names = fieldnames(self.observables);
            for i = 1:numel(observable_names)
                obs_matrix = self.observables.(observable_names{i});
                species = obs_matrix(1, :);
                coefficients = obs_matrix(2, :);
                y_obs.(observable_names{i}) = ...
                                y(:, species) * coefficients';
            end
        end
    end
end

